import styled from "styled-components";

export const Wrapper = styled.div `
    width: 100%;
    height: 20vh;
    position:relative;
    background: #1c3d5a;
    background-image:
    linear-gradient(
      to right, 
      #3776ab, #1c3d5a
    );
`;
